// Prototipos inicialización
conv2d_layer_t init_conv2d_data(void);
conv2d_layer_t init_conv2d_1_data(void);
conv2d_layer_t init_conv2d_2_data(void);
dense_layer_t init_dense_data(void);
dense_layer_t init_dense_1_data(void);
dense_layer_t init_dense_2_data(void);


// Variables Globales
conv2d_layer_t conv2d_data;
conv2d_layer_t conv2d_1_data;
conv2d_layer_t conv2d_2_data;
dense_layer_t dense_data;
dense_layer_t dense_1_data;
dense_layer_t dense_2_data;


void model_init(){
    conv2d_data = init_conv2d_data();
    conv2d_1_data = init_conv2d_1_data();
    conv2d_2_data = init_conv2d_2_data();
    dense_data = init_dense_data();
    dense_1_data = init_dense_1_data();
    dense_2_data = init_dense_2_data();

}

void model_predict(data3d_t input, data1d_t * output){
  
    
    //*************** LAYER 0 **************//
    // Layer name: conv2d
    data3d_t output0;
        // convert image for first EmbedIA Conv2d layer
        image_adapt_layer(input, &output0);
        input = output0;
    
     conv2d_layer(conv2d_data, input, &output0);
    // Activation layer for conv2d
    relu_activation(output0.data, 576);
    
    //*************** LAYER 1 **************//
    // Layer name: dropout
    input = output0;
    
    
    //*************** LAYER 2 **************//
    // Layer name: conv2d_1
    input = output0;
    conv2d_layer(conv2d_1_data, input, &output0);
    // Activation layer for conv2d_1
    relu_activation(output0.data, 800);
    
    //*************** LAYER 3 **************//
    // Layer name: dropout_1
    input = output0;
    
    
    //*************** LAYER 4 **************//
    // Layer name: conv2d_2
    input = output0;
    conv2d_layer(conv2d_2_data, input, &output0);
    // Activation layer for conv2d_2
    relu_activation(output0.data, 768);
    
    //*************** LAYER 5 **************//
    // Layer name: dropout_2
    input = output0;
    
    
    //*************** LAYER 6 **************//
    // Layer name: max_pooling2d
    input = output0;
    static const pooling2d_layer_t max_pooling2d_data = { 2, 2 };
    max_pooling2d_layer(max_pooling2d_data, input, &output0);
    
    //*************** LAYER 7 **************//
    // Layer name: flatten
    input = output0;
    data1d_t output1;
    flatten3d_layer(input, &output1);
    
    //*************** LAYER 8 **************//
    // Layer name: dense
    data1d_t input1;
    input1 = output1;
    dense_layer(dense_data, input1, &output1);
    
    // Activation layer for dense
    relu_activation(output1.data, 128);
    
    //*************** LAYER 9 **************//
    // Layer name: dropout_3
    input1 = output1;
    
    
    //*************** LAYER 10 **************//
    // Layer name: dense_1
    input1 = output1;
    dense_layer(dense_1_data, input1, &output1);
    
    // Activation layer for dense_1
    tanh_activation(output1.data, 128);
    
    //*************** LAYER 11 **************//
    // Layer name: dense_2
    input1 = output1;
    dense_layer(dense_2_data, input1, &output1);
    
    // Activation layer for dense_2
    softmax_activation(output1.data, 21);
    

    *output = output1;

}

int model_predict_class(data3d_t input, data1d_t * results){
  
   
    model_predict(input, results);
    
    return argmax(*results);
    //return argmax(data1d_t);

}

